class MyForm(wx.Frame):

    #----------------------------------------------------------------------
    def __init__(self,parent,title):
        super(MyForm, self).__init__(parent, title=title, size=(100,150))

        # Add a panel so it looks the correct on all platforms
        self.panel = wx.Panel(self)
      
        loadbtn = wx.Button(self.panel, label='Load Location', pos=(20, 20))
        loadbtn.Bind(wx.EVT_BUTTON, self.loadFile)

        savebtn = wx.Button(self.panel, label='Save Location', pos=(20,50))
        savebtn.Bind(wx.EVT_BUTTON, self.saveFile)

        runbtn = wx.Button(self.panel, label='Run', pos=(20,80))
        runbtn.Bind(wx.EVT_BUTTON, self.runFile)
        
        self.panel.Bind(wx.EVT_PAINT, self.loadDrawCircles)

        self.Centre()
        self.Show()          
        
    #----------------------------------------------------------------------
    def loadFile(self, event):

        global loadPaths
        global color1

        openFileDialog = wx.FileDialog(self, "Load Protein Files", "", "", 
                                       "Text or FASTA files (*.txt,*.fasta)|*.txt;*.fasta| Protein Data Bank files (*.pdb) |*.pdb", 
                                       wx.FD_OPEN | wx.FD_FILE_MUST_EXIST | wx.FD_MULTIPLE | wx.FD_CHANGE_DIR)
        openFileDialog.ShowModal()
        loadPaths = openFileDialog.GetPaths()
        color1 = "green"
        for i in loadPaths:
            if not (os.path.isfile(i) and (i.split(".")[-1] == "txt" or i.split(".")[-1] == "fasta" or i.split(".")[-1] == "pdb")):
                color1 = "red"
        self.panel.Refresh()
        openFileDialog.Destroy()

    #----------------------------------------------------------------------
    def saveFile(self, event):

        global savePath
        global color2

        saveFileDialog = wx.DirDialog(self, "Save Result Location", "")
        saveFileDialog.ShowModal()
        savePath = saveFileDialog.GetPath()
        color2 = "green"
        if not os.path.isdir(savePath):
            color2 = "red"
        self.panel.Refresh()
        saveFileDialog.Destroy()

    #----------------------------------------------------------------------
    def runFile(self, event):
        
        global results
        global cutoff

        if color1 == "green" and color2 == "green":
                dialog = wx.ProgressDialog('RPIMapPr: Doing Stuff', 'Please wait...',len(loadPaths))
                dialogct = 0
                success= "No Errors"
                for i in loadPaths:
                        filetype = i.split(".")[-1]
                        filedrop = open(i, 'r')
                        results = ["error", "Incorrect file type."]
                        if filetype == "txt" or filetype == "fasta":
                            start(fastaanalyze(filedrop.read(), cutoff), dialog)
                        elif filetype == "pdb":
                            start(pdbanalyze(filedrop.read(), cutoff), dialog)
                        if results[0] == "success":
                            dialogct += 1
                            dialog.Update(dialogct,str(dialogct)+" out of "+str(len(loadPaths))+" complete.")
                            if filetype == "txt" or filetype == "fasta":
                                file1 = open(savePath + "\\" + os.path.basename(i) + "_rpimappr.fasta", 'w')
                                file1.write(results[1])
                            elif filetype == "pdb":
                                file1 = open(savePath + "\\" + os.path.basename(i) + "_rpimappr.fasta", 'w')
                                file1.write(results[1])
                                file2 = open(savePath + "\\" + os.path.basename(i) + "_rpimappr.pdb", 'w')
                                file2.write(results[2])
                        elif results[0] == "error":
                            success = str(len(loadPaths) - dialogct) + " out of " + str(len(loadPaths)) + " had errors."
                dialog.Destroy()
                dialogsuccess = wx.MessageBox(success,'Analysis Completed')
                    

    #----------------------------------------------------------------------
    def loadDrawCircles(self,event):
        global color1
        global color2

        dc = wx.PaintDC(self.panel)
        dc.SetPen(wx.Pen('#d4d4d4'))
        dc.SetBrush(wx.Brush(color1))
        dc.DrawCircle(125,30,5)
        dc.SetBrush(wx.Brush(color2))
        dc.DrawCircle(125,60,5)

def start(func, *args): # helper method to run a function in another thread
    thread = threading.Thread(target=func, args=args)
    thread.setDaemon(True)
    thread.start()
    
def tryint(s):
    try:
        return int(s)
    except:
        return s
     
def alphanum_key(s):
    return [ tryint(c) for c in re.split('([0-9]+)', s) ]

